[Form]
public class TSTableVersion extends FormRun
{
    ProjPeriodLine                  projPeriodLine;
    ProjPeriodTimesheetWeek         projPeriodTimesheetWeek;

}

void refreshTimesheetGrid()
{
    QueryBuildDataSource tsLineQbds;

    tsLineQbds = tsTimesheetLineLog_ds.query().dataSourceTable(tableNum(TSTimesheetLineLog));
    tsLineQbds.clearRanges();
    tsLineQbds.addSortField(fieldNum(TSTimesheetLineLog, TimesheetNbr));
    tsLineQbds.addRange(fieldNum(TSTimesheetLineLog, TimesheetNbr)).value(queryValue(tsTimesheetTableLog.TimesheetNbr));
    tsLineQbds.addRange(fieldNum(TSTimesheetLineLog, ProjPeriodTimesheetWeek)).value(queryValue(projPeriodTimesheetWeek.RecId));
    tsTimesheetLineLog_ds.executeQuery();
}

void setDates()
{
    str periodDates;

    if (projPeriodLine != null && projPeriodLine.RecId != 0)
    {
        if (projPeriodTimesheetWeek == null || projPeriodTimesheetWeek.RecId == 0)
        {
            projPeriodTimesheetWeek = ProjPeriodTimesheetWeek::findFromPeriod(projPeriodLine.PeriodId, TSTimesheetTableLog.PeriodFrom);
        }

        periodDates = TSTimesheetTable::startDateEndDate(projPeriodTimesheetWeek.PeriodFrom, projPeriodTimesheetWeek.PeriodTo);

        timesheetWeek.text(periodDates);

        this.setLineGridDays(projPeriodLine.PeriodId, projPeriodTimesheetWeek.PeriodFrom, projPeriodTimesheetWeek.PeriodTo);
    }

    element.refreshTimesheetGrid();
}

void setLineGridDays(ProjPeriodId _periodId, ProjPeriodFrom _periodFrom, ProjPeriodTo _periodTo)
{
    FormRealControl hoursField;
    str             dayField;
    str             dayLabel;

    Array gridDays = TSPeriods::getLineWeekDates(ProjPeriodTable::find(_periodId).WeekStart, _periodFrom, _periodTo);
    int i, dayNum  = 1;

    CommentsDayCombobox.clear();
    str dayControlNames = strReplace(formcontrolstr(TSTableVersion, TSTimesheetLineLog_Hours_1),'1','%1');

    for (i = 1; i <= 7; i++)
    {
        dayField = strFmt(dayControlNames, i);

        hoursField = element.design().controlName(dayField);

        if (any2date(gridDays.value(dayNum)) != dateNull())
        {
            dayLabel = TSPeriods::getDateCaption(any2date(gridDays.value(dayNum)));

            hoursField.visible(true);
            hoursField.label(dayLabel);
            CommentsDayCombobox.add(TSPeriods::getDateCaption(any2date(gridDays.value(dayNum))));
        }
        else
        {
            hoursField.visible(false);
            hoursField.label('');
        }

        dayNum++;
    }
}

/// <summary>
/// Will set the selection based on the selected day in the week.
/// Will also rebind the internal and external comments to show that day.
/// </summary>
/// <param name="_index">
/// The index of the selected day (1 based)
/// </param>
public void setSelectionOnDayIndex(int _index)
{
    TSTimesheetLineWeek_InternalComments.dataField(fieldId2Ext(fieldNum(TSTimesheetLineLog, InternalComments), _index));
    TSTimesheetLineWeek_ExternalComments.dataField(fieldId2Ext(fieldNum(TSTimesheetLineLog, ExternalComments), _index));
    // the combobox is zero based
    CommentsDayComboBox.selection(_index-1);
}

public void executeQuery()
{
    TSTimesheetTableLog     tsTimesheetTableLogRecord;
    TSTimesheetTable        tsTimesheetTableRecord;
    TSTimesheetNbr          timesheetNbr;
    Query                   query;
    QueryBuildDataSource    queryDataSource;

    if (!element.args()
       || !element.args().record())
    {
       throw error(Error::missingParameter(element));
    }

    else if (element.args().dataset()!= tableNum(TSTimesheetTableLog)
            && element.args().dataset()!= tableNum(TSTimesheetTable))
    {
        throw error(Error::missingParameter(element));
    }

    if (element.args().dataset() == tableNum(TSTimesheetTableLog))
    {
        tsTimesheetTableLogRecord = element.args().record();
        timesheetNbr = tsTimesheetTableLogRecord.TimesheetNbr;
    }
    else
    {
        tsTimesheetTableRecord = element.args().record();
        timesheetNbr = tsTimesheetTableRecord.TimesheetNbr;
    }

    query           = new query();
    queryDataSource = query.addDataSource(tableNum(TSTimesheetTableLog));
    queryDataSource.addRange(fieldNum(TSTimesheetTableLog, TimesheetNbr)).value(timesheetNbr);
    queryDataSource.addOrderByField(fieldNum(TSTimesheetTableLog, CreatedDateTime), SortOrder::Ascending);
    this.query(query);

    super();

    projPeriodLine = ProjPeriodLine::findFromPeriod(TSTimesheetTableLog.ProjPeriodId, TSTimesheetTableLog.PeriodFrom);

    element.setDates();
}

public void lookup()
{
    Args args;
    FormRun formRun;

    args = new Args(formStr(TSTimesheetWeekLookup));
    args.record(projPeriodLine);
    formRun = classfactory.formRunClass(args);
    formRun.init();
    this.performFormLookup(formRun);
    formRun.wait();

    projPeriodTimesheetWeek = formRun.selectRecordModeSelectedRecord();
    if (projPeriodTimesheetWeek.RecId != 0)
    {
        tsTimesheetTableLog.ProjPeriodTimesheetWeek = projPeriodTimesheetWeek.RecId;
        element.setDates();
    }
}

public int selectionChange()
{
    int ret;

    ret = super();

    // combobox is zero based dayIndex is 1 based
    element.setSelectionOnDayIndex(this.selection()+1);

    return ret;
}

public void jumpRef()
{
    MenuFunction    menuFunction;
    Args            args = new Args();

    super();

    menuFunction = new MenuFunction(menuitemDisplayStr(TaxGroup), MenuItemType::Display);

    changecompany(tsTimesheetLineLog.ProjectDataAreaId)
    {
        args.lookupRecord(TaxGroupHeading::find(tsTimesheetLineLog.TaxGroupId));
        args.caller(element);

        menuFunction.copyCallerQuery(CopyCallerQuery::No);
        menuFunction.run(args);
    }
}

